        internal static string EMAIL
        {
            get { return RANDOM_NUMBER + "-test@test.com"; }
        }
        
        private static string GetRandomNumber()
        {
            Random rnd = new Random();
            int randomNumber = rnd.Next(000001, 999999);
            return randomNumber.ToString();
        }
        
        private static string _randomNumber;
        internal static string RANDOM_NUMBER
        {
            get
            {
                if (null == _randomNumber) _randomNumber = GetRandomNumber();

                return _randomNumber;
            }
        }

        private static List<KeyValuePair<AccountType, string>> _testCerts = new List<KeyValuePair<AccountType, string>>();
        internal static List<KeyValuePair<AccountType, string>> TestCerts
        {
            get { return _testCerts; }
            set { _testCerts = value; }
        }

        internal static string GetTestCert(AccountType type)
        {
            foreach(var cert in TestCerts)
            {
                if (cert.Key == type) return cert.Value;
            }
            return null;
        }

        private static EmailCreateCertRequest BuildCreateModel()
        {
            return new EmailCreateCertRequest()
            {
                CertProfileName = "TEST Patient",
                AccountType = AccountType.Patient,
                Email = EMAIL,
                City = CITY,
                State = STATE,
                NameFirst = NAME_FIRST,
                NameLast = NAME_LAST,
                CreatedBy = BY
            }; 
        }

        private static EmailUpdateCertRequest BuildUpdateModel()
        {
            return new EmailUpdateCertRequest()
            {
                CertProfileName = "TEST Patient",
                AccountType = AccountType.Patient,
                Email = EMAIL,
                City = CITY,
                State = STATE,
                NameFirst = NAME_FIRST,
                NameLast = NAME_LAST,
                ModifiedBy = BY
            };
        }

